  input: TEXT,F3XA,,"On January 18, 2002, IEC-PAC held an auction. IEC paid a total
    of $2,800.00 for two magazine articles and received $2,600.00 in receipts. One-third
    ($866.67) of the amount raised ($2,600.00) is less than the cost of the auction
    items ($2,800.00) and under the one-third rule, IEC-PAC will reimburse IEC the
    $1,933.33 difference. Darryl Vasko purchased one of the magazine articles referenced
    in this report for $1,300.00. IEC-PAC reported receiving $1,000.00 from Darryl
    Vasko on 1/24/02 and the difference was paid to our Political Education Fund.
    Bonnie Chafin purchased the second magazine article for $1,300.00 as reported
    on 5/23/02 in combination with an additional auction item."
